import React, { useState } from "react";

export default function MatchEngine() {
  const [formData, setFormData] = useState({
    name: "",
    college: "",
    field: "",
    year: "",
    skills: "",
    location: "",
    sector: ""
  });

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form submitted:", formData);
    alert("Form submitted! Check console for data.");
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-50 p-6">
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-xl shadow-lg w-full max-w-md">
        <h2 className="text-2xl font-bold mb-4 text-gray-800">Enter Your Details</h2>
        <input name="name" placeholder="Full Name" value={formData.name} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="college" placeholder="College/University" value={formData.college} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="field" placeholder="Field of Study" value={formData.field} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="year" placeholder="Graduation Year" value={formData.year} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="skills" placeholder="Skills (Python, React, etc.)" value={formData.skills} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="location" placeholder="Preferred Location" value={formData.location} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <input name="sector" placeholder="Sector of Interest" value={formData.sector} onChange={handleChange} className="w-full mb-3 p-3 border rounded-lg" />
        <button type="submit" className="w-full bg-blue-800 text-white py-3 rounded-lg mt-4 font-semibold hover:bg-blue-900 transition">
          Submit
        </button>
      </form>
    </div>
  );
}
